css:
.workspace {
  font-family: "Helvetica Neue";
}
.btn {
  border-radius: 3px;
  background: #fff;
  border-style: solid;
  border-width: 1px;
  box-shadow: 0 1px 0 rgba(0, 0, 0, 0.05);
  border-top-color: #C9C9C9!important;
  border-left-color: #C3C3C3!important;
  border-right-color: #C3C3C3!important;
  border-bottom-color: #BCBCBC!important;
  font: normal 11px/23px "Helvetica Neue";
  padding: 0 12px;
  color: #222;
}
.btn:focus,
.btn:active,
.btn.selected {
  background-image: linear-gradient(#69b1fa, #0d80fd);
  box-shadow: 0 1px 0 rgba(0, 0, 0, 0.05);
  border-top-color: #4AA0F9!important;
  border-left-color: #2D85FC!important;
  border-right-color: #2D85FC!important;
  border-bottom-color: #035EFD!important;
  color: #fff;
}
.btn.disabled:hover,
.btn[disabled]:hover,
fieldset[disabled] .btn:hover,
.btn.disabled:focus,
.btn[disabled]:focus,
fieldset[disabled] .btn:focus,
.btn.disabled:active,
.btn[disabled]:active,
fieldset[disabled] .btn:active,
.btn.disabled.active,
.btn[disabled].active,
fieldset[disabled] .btn.active {
  background: red;
}
.editor.mini {
  background: #FFF;
  box-sizing: border-box;
  font-family: "Helvetica Neue" !important;
  font-size: 12px;
  padding: 0 5px;
  border-radius: 3px;
  background: #fff;
  border-style: solid;
  border-width: 1px;
  box-shadow: 0 1px 0 rgba(0, 0, 0, 0.05);
  border-top-color: #C9C9C9!important;
  border-left-color: #C3C3C3!important;
  border-right-color: #C3C3C3!important;
  border-bottom-color: #BCBCBC!important;
  line-height: 23px;
}
.editor.mini .placeholder-text {
  color: #999;
}
.editor.mini .cursor {
  border-color: #ccc;
}
.editor.mini .gutter.drop-shadow {
  -webkit-box-shadow: -2px 0px 10px 2px #222222;
}
.editor-colors.mini {
  color: #555;
}
.editor.mini .selection .region {
  background-color: rgba(56, 146, 227, 0.25);
}
.wrap-guide {
  display: none!important;
}
@-webkit-keyframes highlight {
  from {
    background-color: rgba(56, 146, 227, 0.7);
  }
  to {
    background-color: null;
  }
}
.editor .highlighted.selection .region {
  -webkit-animation-name: highlight;
  -webkit-animation-duration: 1s;
  -webkit-animation-iteration-count: 1;
}
.editor .invisible-character {
  opacity: 0.25;
}
.overlay {
  background-color: #fff;
  border: none;
  color: #333;
  padding: 12px;
  box-shadow: rgba(0, 0, 0, 0.1) 0 0 0 1px, rgba(0, 0, 0, 0.3) 0 5px 20px;
}
.overlay.from-top {
  top: 58px;
  border-radius: 5px;
}
.select-list {
  color: #555;
  background: rgba(255, 255, 255, 0.9);
  border: none;
  padding: 0;
  -webkit-transform: rotate3d(0, 0, 0);
}
.select-list .editor.mini {
  margin-bottom: 0;
  border: 0;
  box-shadow: none;
  padding: 10px 15px;
  background: transparent;
}
.select-list .editor.mini .lines {
  font-size: 18px;
  font-weight: 200;
  letter-spacing: .03em;
}
.select-list .loading {
  position: absolute;
  right: 24px;
  top: 18px;
}
.select-list.popover-list {
  border-radius: 5px;
  padding: 0;
}
.select-list.popover-list ol {
  width: auto !important;
}
.select-list.popover-list ol li {
  padding: 6px 9px;
}
.list-group {
  background: transparent!important;
}
.select-list .error {
  font: 300 13px/17px "Helvetica Neue";
  color: #999;
  padding: 0;
}
.select-list .loading {
  color: #333;
}
.select-list ol.list-group,
.select-list .error-message {
  background: #fff;
  box-shadow: inset rgba(0, 0, 0, 0.1) 0 1px 0;
  margin: 0;
  border-radius: 0 0 5px 5px;
}
.select-list .error-message {
  padding: 10px 12px;
  font-size: 12px;
}
.select-list ol li {
  background-color: transparent;
  position: relative;
  padding: 6px 12px;
  z-index: 1;
  box-shadow: inset rgba(0, 0, 0, 0.1) 0 1px 0;
}
.select-list ol li:not(.selected):hover {
  background-color: #f9f9f9;
}
.select-list ol li .primary-line:before {
  display: none;
}
.select-list ol li,
.select-list ol li .primary-line {
  font: 400 13px/17px "Helvetica Neue";
  -webkit-font-smoothing: antialiased;
  color: #333;
}
.select-list ol li.selected + li {
  box-shadow: none;
}
.select-list ol .selected {
  background: #0856E9;
  box-shadow: inset rgba(0, 0, 0, 0.1) 0 1px 0, inset rgba(0, 0, 0, 0.1) 0 -1px 0;
  color: #fff;
  z-index: 2;
}
.select-list ol .selected .primary-line {
  color: #fff;
}
.select-list ol .selected .right,
.select-list ol .selected .secondary-line {
  color: #fff;
  opacity: 0.7;
}
.select-list .status {
  float: right;
  margin-top: 3px;
}
.select-list ol .secondary-line {
  padding: 0;
  margin: 0;
}
.select-list ol .right,
.select-list ol .secondary-line {
  color: #b8b8b8;
  font: 11px/17px "Helvetica Neue";
}
.select-list ol .modified {
  color: #f78a46;
}
.select-list ol li.selected .modified,
.select-list ol li.selected .new {
  color: #fff;
  opacity: 0.7;
}
.select-list ol .new {
  color: #5293d8;
}
.select-list ol li.active-item:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 14px;
  width: 14px;
  height: 14px;
  content: "\f03a";
}
.select-list ol li.selected:before {
  display: none;
}
.select-list ol .key-binding {
  font: 11px "Helvetica Neue";
  border-radius: 2px;
  margin-left: 5px;
  padding: 3px;
  font-size: 11px;
  opacity: 0.7;
}
.tree-view {
  font: 11px/15px "Helvetica Neue";
  background: #ffffff00;
  padding: 4px 6px;
  min-width: 0;
}
.focusable-panel {
  opacity: 1;
}
.tree-view-scroller {
  border-top: 1px solid #b8b8b8;
  overflow-x: hidden;
}
.is-blurred .tree-view-scroller {
  border-color: #989898;
}
.unity-ui-fullscreen .tree-view-scroller {
  border-top: none;
}
.panel-left .tree-view-scroller {
  border-right: 1px solid #b8b8b8;
}
.panel-right .tree-view-scroller {
  border-left: 1px solid #b8b8b8;
}
.header.list-item {
  display: block;
}
.tree-view.list-group .selected > *,
.tree-view.list-tree .selected > * {
  position: static;
}
.tree-view .file .name {
  margin: 0;
}
.tree-view .entry {
  min-height: 23px;
}
.tree-view .directory .entries {
  margin-left: 14px;
}
.tree-view.list-group li:not(.list-nested-item),
.tree-view.list-tree li:not(.list-nested-item),
.tree-view.list-group li.list-nested-item > .list-item,
.tree-view.list-tree li.list-nested-item > .list-item {
  line-height: 22px;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  padding-left: 0;
}
.list-tree.has-collapsable-children li.list-item {
  margin-left: 15px;
}
.tree-view .entry .name {
  color: #555;
  vertical-align: middle;
  display: inline-block;
  position: relative;
  left: 0;
  top: 0;
  right: 0;
  width: 100%;
  overflow: hidden;
  text-overflow: ellipsis;
  box-sizing: border-box;
  white-space: nowrap;
  line-height: 21px;
  padding-left: 15px;
}
.tree-view .entry.status-new > .name,
.tree-view .entry.status-modified > .name {
  padding-right: 18px;
}
.tree-view .selected:before {
  color: #fff;
  background: #0856E9;
}
.tree-view:focus .selected:before {
  color: #fff;
  background: #0856E9;
}
.tree-view:focus .selected.new:before,
.tree-view:focus .selected.modified:before {
  color: #fff;
  opacity: 0.7;
}
.tree-view .directory > .header {
  line-height: 17px;
}
.tree-view .selected.entry > .header > .name,
.tree-view .selected.entry > .name {
  color: #fff;
}
.tree-view .entry > .header > .name:before,
.tree-view .entry > .name:before {
  display: none;
}
.tree-view .entry.selected > .header > .name:before,
.tree-view .entry.selected > .name:before {
  color: #fff;
}
.tree-view .entry .name {
  vertical-align: middle;
  display: inline-block;
  padding-left: 2px;
}
.tree-view.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item:before {
  width: 9px;
  height: 9px;
  content: '';
  display: inline-block;
  background: -webkit-image-set(url(data:image/png;base64,) 1x, url(data:image/png;base64,) 2x) center;
  position: relative;
  top: 3px;
}
.tree-view.list-tree.has-collapsable-children .list-nested-item > .list-item:before {
  top: 4px;
  left: 2px;
  width: 9px;
  height: 9px;
  content: '';
  background: -webkit-image-set(url(data:image/png;base64,) 1x, url(data:image/png;base64,) 2x) center;
}
.tree-view .ignored {
  color: #999;
}
.tree-view .modified:before {
  color: #f78a46;
}
.tree-view .status-added:after,
.tree-view .status-modified:after {
  font-family: "Octicons Regular";
  font-size: 16px;
  line-height: 1;
  content: '\f06b';
  position: absolute;
  color: rgba(0, 0, 0, 0.3);
  right: 12px;
  margin-top: 4px;
  height: 10px;
  width: 10px;
  -webkit-font-smoothing: antialiased;
  z-index: 5;
}
.tree-view .selected.status-added:after,
.tree-view .selected.status-modified:after {
  color: #fff;
}
.tree-view .expanded.new:before,
.tree-view .expanded.modified:before {
  display: none;
}
.tree-view:focus .status-added:after,
.tree-view:focus .status-modified:after {
  opacity: 1.0;
}
.tree-view:focus .selected.status-added:after,
.tree-view:focus .selected.status-modified:after {
  color: #fff;
}
.tree-view .status-modified:after {
  content: "\f06d";
}
.tree-view .collapsed.status-added:after,
.tree-view .collapsed.status-modified:after {
  margin-top: -17px;
}
.tree-view .expanded.status-added:after,
.tree-view .expanded.status-modified:after {
  display: none;
}
.tree-view-dialog {
  font: 13px "Helvetica Neue";
  font-weight: normal;
}
.tab-bar {
  font: 11px "Helvetica Neue";
  height: 24px;
  margin: 0px;
  background: linear-gradient(#cdcccd, #c7c6c7);
  display: table;
  width: 100%;
  padding: 0;
}
.tab-bar .tab {
  box-sizing: border-box;
  padding: 0 20px!important;
  line-height: 24px;
  color: #696869;
  text-align: center;
  position: relative;
  border-top: 1px solid #b7b5b7;
  border-bottom: 1px solid #b7b5b7;
  border-left: 1px solid #b7b5b7;
  display: table-cell;
  letter-spacing: .03em;
}
.tab-bar .tab:first-child {
  border-left: none;
}
.tab-bar .tab:last-child {
  border-right: none;
}
.tab.active,
.tab:hover.active {
  color: #202020;
  background: linear-gradient(#dddcdd, #d6d5d6);
  border: solid 1px red;
  border-top-color: #B5B4B5;
  border-left-color: #B7B6B7;
  border-right-color: #B7B6B7;
  border-bottom-color: #A8A7A8;
}
.tab.active + .tab,
.tab:hover.active + .tab {
  border-left: none;
}
.tab-bar .tab .title {
  padding: 0!important;
}
.tab-bar .tab .close-icon {
  color: #777;
  cursor: default;
  top: 0;
  left: 0;
  height: 24px;
  width: 20px;
  right: auto;
  position: absolute;
  display: none;
}
.tab-bar .tab .close-icon:before {
  content: '✕';
  position: absolute;
  top: 6px;
  left: 5px;
  width: 12px;
  height: 13px;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  display: block;
  top: 0;
  border: none;
}
.tab-bar .tab:hover .close-icon {
  display: block;
}
.tab .icon:before {
  display: none;
}
.is-blurred .tab-bar {
  background: #E4E4E4;
}
.is-blurred .tab-bar .tab {
  border-right-color: #ADADAD;
  border-left-color: #ADADAD;
  color: #727272;
}
.is-blurred .tab-bar .tab.active,
.is-blurred .tab-bar .tab:hover.active {
  background: #F5F5F5;
}
.panes .pane-row > * {
  border-right: 1px solid #717171;
}
.panes .pane-row > *:last-child {
  border-right: none;
}
.panes .pane-column > * {
  border-bottom: 1px solid #565656;
}
.panes .pane-column > *:last-child {
  border-bottom: none;
}
.status-bar.tool-panel {
  color: #333;
  text-shadow: rgba(255, 255, 255, 0.4) 0 1px;
  height: 28px;
  line-height: 23px;
}
.status-bar.tool-panel .icon:before {
  font-size: 16px;
  top: 3px;
}
.status-bar.tool-panel .prompt {
  margin-bottom: 3px;
  position: relative;
}
.status-bar.tool-panel .prompt:before {
  color: rgba(0, 0, 0, 0.2);
  line-height: 1;
  top: 1px;
  display: inline-block;
  position: relative;
}
.status-bar.tool-panel .git-status.octicons.modified-status-icon {
  color: #f78a46;
  display: inline-block;
}
.status-bar.tool-panel .git-status.octicons.new-status-icon {
  color: #5293d8;
  display: inline-block;
}
.status-bar.tool-panel .git-status.octicons.ignored-status-icon {
  color: #333;
  display: inline-block;
}
.status-bar.tool-panel .grammar-name {
  margin: -3px;
  padding: 2px;
  border: 1px solid transparent;
}
.status-bar.tool-panel .grammar-name:hover {
  color: #000;
  border: 1px solid rgba(50, 50, 50, 0.2);
  border-radius: 2px;
}
.tool-panel.panel-bottom {
  background-color: #f8f8f8;
  border-top: none;
  padding: 8px 10px 12px;
  box-shadow: rgba(0, 0, 0, 0.3) 0 -1px 0;
  z-index: 1;
}
.find-and-replace .find-meta-container {
  top: 4px;
}
.btn-group > .btn:first-child {
  border-style: solid;
  border-left-width: 1px;
  border-top-left-radius: 3px;
  border-bottom-left-radius: 3px;
}
.btn-group > .btn:last-child,
.btn-group > .btn.selected:last-child,
.btn-group > .dropdown-toggle {
  border-style: solid;
  border-right-width: 1px;
  border-top-right-radius: 3px;
  border-bottom-right-radius: 3px;
}
.btn-group > .btn {
  height: 25px;
  font-size: 12px;
}
.project-find .find-container .btn-toggle.btn-group,
.project-find .replace-container .btn-toggle.btn-group,
.project-find .paths-container .btn-toggle.btn-group {
  width: 100px;
}
.tool-panel .block {
  font-size: 12px;
}
.tool-panel .panel-heading {
  background: #F3F3F3;
  border: 1px solid #A8A8A8;
  border-bottom: none;
  border-radius: 4px 4px 0 0;
  box-shadow: inset rgba(255, 255, 255, 0.25) 0 -1px 0, inset #ffffff 0 1px 0;
  padding: 6px 8px;
  font: 500 13px "Helvetica Neue";
}
.tool-panel .error-messages {
  padding: 0 0 10px;
  color: #911;
  font: 500 13px/15px "Helvetica Neue";
  text-shadow: rgba(255, 255, 255, 0.8) 0 1px;
}
.command-logger {
  background: #1e1e1e;
  color: #eee;
  padding-top: 10px;
  padding-bottom: 10px;
}
.command-logger .category-header {
  text-align: center;
  padding-bottom: 5px;
  font-size: 16px;
}
.command-logger .category-summary {
  text-align: center;
  padding-bottom: 10px;
  font-size: 12px;
}
.command-logger .tree-map {
  margin: auto;
  background-color: #efefef;
  border: 1px solid #999;
}
body.command-logger-node-text {
  background-color: transparent;
}
.command-logger-node-text div {
  display: table-cell;
  vertical-align: middle;
  text-align: center;
  cursor: pointer;
}
.command-logger-node-text span {
  font-size: 10px;
  color: #fff;
  text-shadow: #000 1px 1px 4px;
}
.is-blurred .tree-view {
  /* background: #f3f3f3; */
}
.is-blurred .tree-view .selected:before {
  /* background-image: linear-gradient(#efefef, #e1e1e1);
  box-shadow:inset rgba(255,255,255,0.6) 0 2px 0, inset rgba(0,0,0,0.4) 0 1px, inset rgba(0,0,0,0.1) 0 -1px; */
}
.is-blurred .tree-view .selected.entry > .name,
.is-blurred .tree-view .selected.entry > .header > .name {
  /* color:#555;
  text-shadow:rgba(255,255,255,0.4) 0 1px; */
}
.image-view {
  align-self: center;
  -webkit-flex: 1;
  -webkit-align-items: center;
  margin: auto;
  overflow: visible;
}
.image-view img {
  padding: 0;
  border: none;
  box-shadow: rgba(0, 0, 0, 0.8) 0 5px 30px;
  background-image: -webkit-image-set(url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAKCAYAAACNMs+9AAAALUlEQVQYGWN89uzZfwY0ICkpiSbCwMCEIYJDYAAVMv4HAnRnPX/+HF1oSHgGAHl1CsBZvEw0AAAAAElFTkSuQmCC) 1x, url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAUCAYAAACNiR0NAAAASklEQVQ4EWN89uzZfwYigKSkJBGqGBiYiFJFgqJRA0kILBxKR8MQR8CQIMz4HwiIUf/8+XNilI3mFKJCCb+i0YSNP3yIkaV6GAIAVdAK1ELvYjwAAAAASUVORK5CYII=) 2x);
  -webkit-user-select: none;
}
.preview-pane .panel-heading {
  font-size: 13px;
  padding: 10px 12px;
  background: #f8f8f8;
  box-shadow: rgba(0, 0, 0, 0.12) 0 1px 0, rgba(0, 0, 0, 0.05) 0 2px 0;
  z-index: 2;
}
.preview-pane .results-view {
  padding: 0;
  overflow-x: hidden;
  background: #f4f4f4;
}
.preview-pane .results-view > li:last-child {
  box-shadow: rgba(0, 0, 0, 0.05) 0 1px 1px;
}
.preview-pane .path-details {
  border-top: 1px solid #ededed;
  border-bottom: 1px solid #E8EAED;
  font-weight: bold;
  color: #5E91AA;
  background: #F1F4F7;
  box-shadow: inset rgba(255, 255, 255, 0.5) 0 1px 0;
  padding: 0 12px;
  line-height: 24px;
  font-size: 11px;
  text-shadow: #fff 0 1px 0;
}
.preview-pane .path-details .icon {
  display: none;
}
.preview-pane li.path {
  margin-top: -1px;
}
.preview-pane .matches {
  display: table;
  border-collapse: collapse;
  width: 100%;
  background: #fff;
}
.preview-pane .matches .highlight-info,
.preview-pane .matches .highlight-error,
.preview-pane .matches .highlight-success {
  border-radius: 2px;
  background: #3E9AD3;
  color: #fff;
  padding: 2px;
}
.preview-pane .matches .highlight-error {
  background: #D54426;
}
.preview-pane .matches .highlight-success {
  background: #6FC44C;
}
.preview-pane .matches li.search-result {
  font-size: 11px;
  display: table-row;
}
.preview-pane .matches li.search-result.selected:before {
  display: none;
}
.preview-pane .matches li.search-result > span {
  padding: 0 12px;
  display: table-cell;
  font-size: 11px;
  line-height: 24px;
  font-family: "Helvetica Neue";
  box-shadow: 0 1px 0 rgba(0, 0, 0, 0.05);
  overflow: hidden;
}
.preview-pane .matches li.search-result.selected > span {
  background: #3E9AD3;
  color: #fff;
}
.preview-pane .matches li.search-result.selected + li > span {
  box-shadow: none;
}
.preview-pane .matches li.search-result.selected .highlight-info,
.preview-pane .matches li.search-result.selected .highlight-success {
  background: rgba(255, 255, 255, 0.4);
}
.preview-pane .matches li.search-result.selected .highlight-error {
  background: rgba(0, 0, 0, 0.4);
}
.preview-pane .matches li.search-result span.line-number {
  width: 1px;
  box-shadow: 0 1px 0 rgba(0, 0, 0, 0.05), inset -1px 0 0 rgba(0, 0, 0, 0.05);
}
.background-message {
  font-family: "Helvetica Neue";
  font-weight: 100;
  text-shadow: rgba(255, 255, 255, 0.9) 0 1px 0;
  color: #727272;
}
.tooltip-inner {
  background: #f8f8f8;
  border-radius: 5px;
  font-size: 12px;
